DROP TABLE IF EXISTS `assets`;

CREATE TABLE `assets`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(256) NOT NULL,
  `serial` VARCHAR(256) ,
  `assetnumber` VARCHAR(256),
  `deploymentstatus` VARCHAR(256),
  `asset_label` VARCHAR(256),
  `created_at` DATETIME,
  `updated_at` DATETIME,
  PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `assets_devices`;

CREATE TABLE `assets_devices`(
	`asset_id` SMALLINT UNSIGNED NOT NULL,
	`device_id` SMALLINT UNSIGNED NOT NULL
);

DROP TABLE IF EXISTS `clients`;

CREATE TABLE `clients` (
	`id`	SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(256),
  `created_at` DATETIME,
  `updated_at` DATETIME,
  PRIMARY KEY (`id`)
);



DROP TABLE IF EXISTS `compliances`;

CREATE TABLE `compliances` (
	`id`	SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`product` VARCHAR(256) NOT NULL,
	`edition` VARCHAR(256),
	`entitlement_qty` TEXT,
	`installs` SMALLINT,
	`value` FLOAT,
	`unit_cost` FLOAT,
	`entitlement_status` ENUM("RED","AMBER","GREEN"), 
	`compliance` SMALLINT,
	`compliance_value` FLOAT,
	`compliance_status` ENUM("RED","AMBER","GREEN"),
	`created_at` DATETIME,
	`updated_at` DATETIME,
	PRIMARY KEY (`id`)
);



DROP TABLE IF EXISTS `countries`;
CREATE TABLE `countries` (
	`id`	SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
  `country` VARCHAR(256),
	`iso_code` VARCHAR(3),
	PRIMARY KEY (`id`)
);



DROP TABLE IF EXISTS `devices`;

CREATE TABLE `devices`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`asset_id` SMALLINT NOT NULL,
  `make` VARCHAR(64) ,
  `model` VARCHAR(64),
  `serial` VARCHAR(64) ,
  `network_user_name` VARCHAR(64),
  `node` VARCHAR(64),
  `os` VARCHAR(64),
  `os_service_level` VARCHAR(64),
  `chassis` VARCHAR(64),
	`domain` VARCHAR(64) NOT NULL,
  `ip` VARCHAR(24) ,
  `processor_count` TINYINT,
  `processor_type` VARCHAR(256),
  `processor_speed` TINYINT,
  `ram` SMALLINT,
  `bios_date` DATE,
  `created_at` DATETIME,
  `updated_at` DATETIME,
  `mac_address` VARCHAR(64) ,
  `location_id` SMALLINT ,
  `client_id` SMALLINT ,
  PRIMARY KEY (`id`)
)






DROP TABLE IF EXISTS `devices_registers`;

CREATE TABLE `devices_registers`(
	`device_id` SMALLINT UNSIGNED NOT NULL,
	`register_id` SMALLINT UNSIGNED NOT NULL,
  PRIMARY KEY (`device_id`,`register_id`)
);


DROP TABLE IF EXISTS `devices_versions`;

CREATE TABLE `devices_versions`(
	`device_id` INTEGER UNSIGNED NOT NULL,
	`version_id` INTEGER UNSIGNED NOT NULL,
  PRIMARY KEY (`device_id`,`version_id`)
);


DROP TABLE IF EXISTS `entitlements`;

CREATE TABLE `entitlements`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
  `installation_id` SMALLINT,
  `version_id` SMALLINT,
	`region` VARCHAR(256) NOT NULL,
	`agreement_type` VARCHAR(256) NOT NULL,
	`licence_type` VARCHAR(256) NOT NULL,
  `location_id` SMALLINT,
  `quantity` SMALLINT,
  `cost` SMALLINT,
	`currency` VARCHAR(256) NOT NULL,
	`document_reference` VARCHAR(256) NOT NULL,
	`document_type` VARCHAR(256) NOT NULL,
  `expiry` DATE,
  `support_expiry` DATE,
  `entitlement_id` SMALLINT,
	`supplier` VARCHAR(256) NOT NULL,
  `created_at` DATETIME,
  `updated_at` DATETIME,
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `installations`;

CREATE TABLE `installations`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
  `version_id` SMALLINT,
  `device_id` SMALLINT,
  `created_at` DATETIME,
  `updated_at` DATETIME,
	PRIMARY KEY (`id`)
);





DROP TABLE IF EXISTS `licences`;

CREATE TABLE `licences`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`sku` VARCHAR(64),
	`identifying_number` VARCHAR(64),
  `cal` VARCHAR(48),
  `licence_type` VARCHAR(64),
  `term` VARCHAR(64),
  `upgrade` VARCHAR(64),
	`term_expiry_date` DATE,
  `ci_name` VARCHAR(64),
  `base_licence` VARCHAR(64),
	`maintenance_expiry` DATE,
  `entitlement_type` VARCHAR(64),
  `cost_centre` VARCHAR(64),
  `volume_licence_agreement_number` VARCHAR(64),
  `agreement_location` VARCHAR(64),
  `entitlement_location` VARCHAR(64),
  `supplier` VARCHAR(64),
  `supplier_invoice_number` VARCHAR(64),
	`invoice_date` DATE,
  `po_number` VARCHAR(64),
  `country_of_usage` VARCHAR(64),
  `product_substitution_rights` VARCHAR(64),
  `secondary_rights` VARCHAR(64),
  `transferability` VARCHAR(64),
  `external_licence_transfer_requirements` VARCHAR(64),
  `linkages` VARCHAR(64),
	`total_cost_of_line_item` INTEGER,
	`quantity` INTEGER,
	`unit` VARCHAR(48),
	`cost_unit` INTEGER,
	`maintenance_pa` INTEGER,
  `created_at` DATETIME,
  `updated_at` DATETIME,
  `client_id` SMALLINT,
  `version_id` INTEGER,
  `country` VARCHAR(128),
	PRIMARY KEY (`id`)
);




DROP TABLE IF EXISTS `locations`;

CREATE TABLE `locations`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(256),
	`reference` VARCHAR(256),
	`address1` VARCHAR(256),
	`address2` VARCHAR(256),
	`address3` VARCHAR(256),
	`address4` VARCHAR(256),
	`country` VARCHAR(256),
	`postcode` VARCHAR(256),
  `created_at` DATETIME,
  `updated_at` DATETIME,
  `site_id` SMALLINT,
	`client_id` SMALLINT,
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `products`;

CREATE TABLE `products`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(256),
	`fullname` VARCHAR(256),
	`publisher_id` SMALLINT,
	`serial` VARCHAR(256),
	`sku` VARCHAR(256),
	`identifier` VARCHAR(256),
  `created_at` DATETIME,
  `updated_at` DATETIME,
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `publishers`;

CREATE TABLE `publishers` (
	`id`	SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`name` VARCHAR (256) NOT NULL,
	`shortname` VARCHAR (256),
	`description` TEXT,
  `created_at` DATETIME,
	`updated_at` DATETIME,
	`url` VARCHAR (256),
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `registers`;

CREATE TABLE `registers` (
	`id`	SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(24),
  `client_id` SMALLINT,
  `date` DATETIME,
  `frequency` VARCHAR(24),
  `regtype` VARCHAR(24),
  `accuracy` SMALLINT,
  `device_id` SMALLINT,
  `asset_id` SMALLINT,
  `created_at` DATETIME,
	`updated_at` DATETIME,
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `registers_servers`;

CREATE TABLE `registers_servers`(
	`register_id` SMALLINT UNSIGNED NOT NULL,
	`server_id` SMALLINT UNSIGNED NOT NULL,
  PRIMARY KEY (`register_id`,`server_id`)
);



DROP TABLE IF EXISTS `servers`;

CREATE TABLE `servers`( 
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(128),
  `client_id` SMALLINT UNSIGNED,
  `alternative_name` VARCHAR(128),
  `alt_reference` SMALLINT UNSIGNED,
  `comment` VARCHAR(512),
  `scope` ENUM("","RED","GREEN","AMBER"),
  `created_at` DATETIME,
  `updated_at` DATETIME,
  PRIMARY KEY (`id`)
); 




DROP TABLE IF EXISTS `sessions`;

CREATE TABLE `sessions`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`session_id` VARCHAR(256) NOT NULL,
	`data` TEXT,
  `created_at` DATETIME,
  `updated_at` DATETIME,
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
	`id`	SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(64) NOT NULL,
	`email` VARCHAR(128) NOT NULL,
	`role` VARCHAR(48) NOT NULL,
	`client_id`	SMALLINT,
	`crypted_password` VARCHAR(255),
	`password_salt` VARCHAR(255),
	`persistence_token` VARCHAR(255),
	`created_at` DATETIME,
	`updated_at` DATETIME,
	PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `versions`;

CREATE TABLE `versions`(
	`id` SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(256),
	`fullname` VARCHAR(256),
	`product_id` SMALLINT,
	`serial` VARCHAR(256),
	`language` VARCHAR(256),
  `created_at` DATETIME,
  `updated_at` DATETIME,
	PRIMARY KEY (`id`)
);



